angular.module('ktvApp', ['ui.bootstrap', 'ngGrid'])
	.config(['$httpProvider', function($httpProvider){
		$httpProvider.defaults.headers.common['X-Requested-With'] = 'XMLHttpRequest'
	}])
	.controller('makeVote', [
		'$rootScope',
		'$scope',
		'$http',
		function($rootScope, $scope, $http){
			VK.init({apiId:3655166});

			var scope = function(k, v){$rootScope.$apply(function(){$scope[k] = v})};

			VK.Auth.getLoginStatus(function(r){scope('vk_na', !r.session)});

			$scope.voteVK = function(e, c){
				var url = 'http://klizmatv.com/contest/' + c;
				if ($scope.vk_na)
					VK.Auth.login(function(r){
						if (r.session) {
							scope('vk_na', 0)
						} else alert('Вы отменили вход\nПопробуйте ещё раз :-)')
					});
				else
					VK.Api.call('wall.post', {message:'Смотреть видео: http://vk.cc/1x8mVK', attachments:url, services:'twitter,facebook'}, function(r){
						if (r.response) {
							/* Модератор проверяет активность на IP адресе, а серверный компонент отслеживает «живучесть» голос-поста */
							/* Модератор видит карту активности и разброс на ней, использовать прокси в таком случае малоэффективно */
							/* Любое подозрение в накрутке — лишает участника голосов в количестве определяемом модератором */
							$rootScope.$apply(function(){
								$http.get('', {headers:{'Vote-Data-Uid':VK.Auth.getSession().mid, 'Vote-Data-Pid':r.response.post_id}})
									.success(function(data){
										$scope.vk_pd = 0;
										$(e.currentTarget).prop('disabled', 1).toggleClass('btn-primary btn-success').text('спасибо');
										if (data) {
											$scope.position = data.position;
											$scope.votes = data.votes
										}
									})
									.error(function(){alert('Произошла ошибка\nПожалуйста, попробуйте позже')})
							})
						} else scope('vk_pd', 1)
					})
			}
		}
	])
	.controller('sendVideo', [
		'$scope',
		'$http',
		function($scope, $http){
			var btn = $('.dToggle'),
				email = $('#email'),
				error = $('#error'),
				preview = $('#preview'),
				insertData = function(data){
					console.log(data.entry);
					if (data.error) {
						error.text(data.error);
						btn.prop('disabled', 0)
					} else {
						error.empty();
						$scope.v = {
							user: data.entry.author[0].name.$t,
							title: data.entry.title.$t,
							video: $scope.video,
							embed: 'Встраивание ' + (data.entry.yt$accessControl[4].permission == 'allowed' ? 'разрешено' : 'запрещено'),
							view: data.entry.yt$statistics.viewCount,
							dislikes: data.entry.yt$rating.numDislikes,
							likes: data.entry.yt$rating.numLikes
						};
						$scope.preview = 1;
						preview.fitVids()
					}
					if (!$scope.addVideo.email.$valid) email.focus()
				};

			$scope.checkVideo = function(){
				btn.prop('disabled', 1);
				$http.get('', {headers:{'Video':$scope.video}})
					.success(insertData)
					.error(function(data, status){insertData({error:status})})
			};

			$scope.rejectVideo = function(){
				$scope.video = $scope.preview = 0;
				btn.prop('disabled', 0)
			};

			email.focus()
		}
	]);